A hash map is a data structure that stores key-value pairs and allows for efficient insertion, retrieval, and deletion operations. In JavaScript, objects and Maps serve as hash maps.

Here's a brief explanation:

```javascript
// Using a plain object as a hash map
const hashMap = {};
hashMap["name"] = "John";
hashMap["age"] = 30;

console.log(hashMap["name"]); // "John"

// Using the Map class (more modern approach)
const map = new Map();
map.set("name", "John");
map.set("age", 30);

console.log(map.get("name")); // "John"
```

Key characteristics:
- Fast O(1) average time complexity for operations
- Keys are unique
- Underlying implementation uses hashing to determine storage location

